Continuing the bock run , a sumptuous local bock. This brewery is tucked away in #Asker about 15 miles west of #Oslo - they make tremendous beers, and this one is especially well crafted.

#Norway loves it's bock, it's somewhat of a #cultural tradition, so lucky me.

Pouring like a flat, full sugar soda, it looks like a Pepsi, from it's 3 second head to it's incredibly viscous attitude - it was almost a suspension, the bubbles working double duty just to make it up to the top.

A rich sweet and smoky beer with a thick mouth feel that does not transfer down with the swallow. Served at a good fridge temperature, I think pouring it out too cold might manipulate the properties of a beer like this. A nice long sipper.

A fantastic traditional bock.

